]

  return (
    <div data-testid="home-page">
      <Container>
        {gamers.map ((cards)=>(
          <Cards>
            <a href='teste'>
              <img src={cards.href} alt=''/>
              <div className='infos'>
                <div className='containerTitle'>
                <span id='title'>Nome do jogo</span>
                <span id='subTitle'>anuncio</span>
                </div>

              </div>
            </a>
          </Cards>
        ))}
      </Container>
    </div>
  );
}
